import styled from 'styled-components';

export const Main = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #F5F5F5;
    display: flex;
    justify-content: center;
    align-items: center;
`;

export const Form = styled.form`
    width: 40%;
    height: auto;
    min-height: 50vh;
    max-width: 600px;
    background-color: red;
`;
